import React from 'react';
import { createRoot } from 'react-dom';
import App from './App';
import '@fortawesome/fontawesome-free/css/all.css';
import './components/assets/index.css';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
